I’m a huge fan of @sachajuanuk’s Ocean Mist Spray so when they very kindly reached out to me to collab I was super excited! As a fellow naturally curly haired gal I decided to try out their curl range as I’m always looking to expand my curly haircare collection and find new products to add definition and tame frizz! This process all starts with using a curl specific shampoo and conditioner which I learnt makes all the difference! After washing my hair it felt full of texture and super beachy 😍 Their Curl Treatment can be used either as an intensive leave in mask or as a styling cream to create bouncier and more defined curls. I scrunched this into damp hair and left to dry naturally. Overall I was really happy with the end result! My curls felt nourished and full of life ✨

Products used:
@sachajuanuk Curl Shampoo 
@sachajuanuk Curl Conditioner 
@sachajuanuk Curl Treatment 
@sachajuanuk Ocean Mist Spray

